import { useState, useEffect } from 'react';

function App() {
  const [obj,setobj] = useState({
    key:'0',
    type : 'same'
  });

  const change = ()=>{
    setobj( ()=>{
      return {
        key : '1',
        type : 'Object'
      }
    })
  }
  return (
    <div>
      <h1>{obj.key} {obj.type}</h1>
      <button onClick={change}>Click</button>
    </div>
  )
}    
export default App;
